import React, {useEffect} from "react";
import "./portfolio.css"
import "./pages.css"

import AOS from "aos"
import "aos/dist/aos.css"

import CodingCard from "../components/codingCard";

const Tech = () => {
    useEffect(()=>{
        AOS.init({duration: 1000, easing:"ease-in-out"});
    }, []);
    return(
        <div>
            <section className={"allInfo"}>
                <div data-aos={"fade-down"}>
                    <h1 className={"mainTitle portfolioTitle"}>development portfolio.</h1>
                    <p className={"subTitle"}>Check out some of my latest projects and apps.</p>
                </div>
                <div className={"projects"}>
                    <CodingCard></CodingCard>
                </div>
            </section>
        </div>
    )
}

export default Tech;
